import React, { Component } from "react";
import "./styles.scss";

class Functions extends Component {
  render() {
    return (
      <div className="container" id="functions">
        <div className="title">
          <h2>Add Product</h2>
        </div>
      </div>
    );
  }
}

export default Functions;
